import './App.css';
import axios from 'axios';
import { useState } from 'react';
import { TextField, Button, Table, TableBody, TableCell, TableHead, TableRow, Paper, Container, Typography } from '@mui/material';
import { Unstable_NumberInput as NumberInput } from '@mui/base/Unstable_NumberInput';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';

function App() {

  const [activeTab, setActiveTab] = useState(0);

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue);
  };

  const [foodData, setFoodData] = useState([]);
  const [foodQuery, setFoodQuery] = useState('');


  const handleFoodChange = (e) => {
    setFoodQuery(e.target.value);
  };


  const handleFoodSearch = async () => {
    const API_KEY = "s6IZPc5umHSS4q56qzDw9d2YkF6BqO1G6rgefhty"

    try {
      const response = await axios.post(`https://api.nal.usda.gov/fdc/v1/foods/search?api_key=${API_KEY}`, {
        query: foodQuery,
      });
      const bestResponse = response.data.foods[0];
      var foods = [...foodData,{
        name: bestResponse.description,
        calories: bestResponse.foodNutrients.find(n => n.nutrientName === "Energy").value,
        protein: bestResponse.foodNutrients.find(n => n.nutrientName === "Protein").value,
        carbohydrates: bestResponse.foodNutrients.find(n => n.nutrientName === "Carbohydrate, by difference").value,
        fat: bestResponse.foodNutrients.find(n => n.nutrientName === "Total lipid (fat)").value,
      } ]
      setFoodData(foods);
    } catch (error) {
      console.error("Error fetching food data:", error);
    }
  };

  return (

    <Container maxWidth="lg">
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            MacroMaster
          </Typography>
          {/* Placeholder for future login/logout functionality */}
        </Toolbar>
      </AppBar>
      <Tabs value={activeTab} onChange={handleTabChange} centered>
        <Tab label="Search food" />
        <Tab label="Physical Activity" />
      </Tabs>
      {/* Placeholder for other tabs' content */}
      {activeTab === 0 && (
        <Container>
        <Typography variant="h6" gutterBottom style={{ marginTop: 20 }}>
          Search for Food Nutrition
        </Typography>
        <TextField
          fullWidth
          label="Enter food name"
          value={foodQuery}
          onChange={handleFoodChange}
          style={{ marginBottom: 10 }}
        />
        <Button variant="contained" color="secondary"  onClick={handleFoodSearch}>Search Food</Button>

        {foodData && (
          <Paper style={{ marginTop: 20 }}>
            <Table>  
              <TableHead>
                <TableRow>
                  <TableCell>Name</TableCell>
                  <TableCell align="right">Calories</TableCell>
                  <TableCell align="right">Protein</TableCell>
                  <TableCell align="right">Carbohydrates</TableCell>
                  <TableCell align="right">Fat</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {foodData ? foodData.map((f) => {return (
                  <TableRow key={f.name}>
                  <TableCell component="th" scope="row"> {f.name} </TableCell>
                  <TableCell align="right">{f.calories}</TableCell>
                  <TableCell align="right">{f.protein}</TableCell>
                  <TableCell align="right">{f.carbohydrates}</TableCell>
                  <TableCell align="right">{f.fat}</TableCell>
                </TableRow>
                )}) : 
                <></>
              }


              </TableBody>
            </Table>
          </Paper>
        )}
      </Container>
      )}
      {activeTab === 1 && (
        <Container>
            <form id="contact-form" method="POST">
                  <label for="day">Date:</label>
                  <input type="date" id="day" name="Macro-Data" value="2018-07-22" min="2018-01-01" max="2018-12-31" />

                  <label for="cal">Calories</label>
                  <input type="number" id="cal" placeholder="Calories (in grams)" min="0" max="100000" />

                  <label for="protien">Protien:</label>
                  <input type="number" id="protien" placeholder="Protien (in grams)" min="0" max="10000" />

                  <label for="carb">Carbs:</label>
                  <input type="number" id="carb" placeholder="Carbs (in grams)" min="0" max="10000" />

                  <label for="fat">Fat:</label>
                  <input type="number" id="fat" placeholder="Fat (in grams)" min="0" max="10000" />

                  <button type="submit">Submit Macros</button>
                </form>
        </Container>
      )}

    </Container>
  );
}

export default App;
